import ReactFC from "react-fusioncharts"
import FusionTheme from "fusioncharts/themes/fusioncharts.theme.fusion";
import CandyTheme from 'fusioncharts/themes/fusioncharts.theme.candy';
ReactFC.fcRoot(FusionCharts, TimeSeries, FusionTheme, CandyTheme);

const jsonify = res => res.json();
const dataFetch = fetch("http://163.152.223.12:5000/get_data").then(jsonify);
const schemaFetch = fetch("http://163.152.223.12:5000/get_schema").then(jsonify);

const dataSource = {
  chart: {theme: "candy"
  },
  caption: {
    text: "DDoS prediction"
  },
  subcaption: {
    text: "We predict whether DDoS attack will occur on the next day or not through the Bitcoin's block statistical data of the previous day."
  },
  series: "Model",
  yaxis: [
    {
      plot: [
        {
          value: "Score",
          type: "column"
        }
      ],
      title: "Detection Score",
      format: {
        suffix: ""
      }
    }
  ]
};

